import React, { useState } from "react";

const TransactionForm = ({ onCreateTransaction }) => {
  const [form, setForm] = useState({
    agent_name: "",
    transaction_number: "",
    sale: "",
  });

  const updateForm = (updatedValues) => {
    setForm((prevForm) => ({ ...prevForm, ...updatedValues }));
  };

  const onSubmit = (event) => {
    event.preventDefault();
    onCreateTransaction(form);
    setForm({
      agent_name: "",
      transaction_number: "",
      sale: "",
    });
    // show confirmation alert
    alert("Transaction created successfully!");
  };

  // Render the form component
  return (
    <div>
      <h3>Create New Transaction</h3>
      <form onSubmit={onSubmit}>
        <div className="form-group">
          <label htmlFor="agent_name">Agent Name</label>
          <select
            className="form-control"
            id="agent_name"
            value={form.agent_name}
            onChange={(event) =>
              updateForm({ agent_name: event.target.value })
            }
          >
            <option value="">Select Agent</option>
            <option value="Goku">Goku</option>
            <option value="Lelouch">Lelouch</option>
            <option value="Naruto">Naruto</option>
            <option value="Bleach">Bleach</option>
          </select>
        </div>
        <div className="form-group">
          <label htmlFor="transaction_number">Transaction Number</label>
          <input
            type="text"
            className="form-control"
            id="transaction_number"
            value={form.transaction_number}
            onChange={(event) =>
              updateForm({ transaction_number: event.target.value })
            }
          />
        </div>

        <div className="form-group">
          <label htmlFor="sale">Sale</label>
          <input
            type="number"
            className="form-control"
            id="sale"
            value={form.sale}
            min="0"
            onChange={(event) =>
              updateForm({ sale: Math.max(0, event.target.value) })
            }
          />
        </div>

        <div className="form-group">
          <input
            type="submit"
            value="Create Transaction"
            className="btn btn-primary"
            data-toggle="modal"
            data-target="#confirmationModal"
          />
        </div>
      </form>

      {/* Confirmation Modal */}
      <div
        className="modal fade"
        id="confirmationModal"
        tabIndex="-1"
        role="dialog"
        aria-labelledby="confirmationModalLabel"
        aria-hidden="true"
      >
        <div className="modal-dialog" role="document">
          <div className="modal-content">
            <div className="modal-header">
              <h5
                className="modal-title"
                id="confirmationModalLabel"
              >
                Transaction Created Successfully
              </h5>
              <button
                type="button"
                className="close"
                data-dismiss="modal"
                aria-label="Close"
              >
                <span aria-hidden="true">&times;</span>
              </button>
            </div>
            <div className="modal-body">
              Your transaction has been created successfully.
            </div>
            <div className="modal-footer">
              <button
                type="button"
                className="btn btn-secondary"
                data-dismiss="modal"
              >
                Close
              </button>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default TransactionForm;
